import React from 'react';
import './Register.css';
import RegisterDetails from '../Register/RegisterDetails';

const registerComponent = () => {
    let registerDetails : RegisterDetails = this.props.object;
  return (
    <div>
          <div id="signup">
                <input type="text" id="first" placeholder="First Name" value = {registerDetails.firstName} onChange = {props.change}/>
                <input type="text" id="last" placeholder="Last Name" value = {registerDetails.lastName}/>
                <input type="email" id="email" placeholder="Email" value = {registerDetails.email}/>
                <input type="password" id="password" placeholder="Password" value = {registerDetails.password}/>
                <input type="text" id="address1" placeholder="Adress 1" value = {registerDetails.addressLine1}/>
                <input type="text" id="address2" placeholder="Adress 2" value = {registerDetails.addressLine2}/>
                <input type="text" id="city" placeholder="City" value = {registerDetails.city}/>
                <input type="text" id="state" placeholder="State" value = {registerDetails.state}/>
                <input type="text" id="country" placeholder="Country" value = {registerDetails.country}/>
                <input type="text" id="zipcode" placeholder="zipcode" value = {registerDetails.zipcode}/>
                <input type="text" id="usertype" placeholder="usertype" value = {registerDetails.usertype}/>
            <button id="send" onClick = {props.click}>Send</button>
    </div>
        </div>
  );

}

export default registerComponent;
